export const website=(value)=>{
    return{
        type:"WebsiteStore",
        payload:value
    }
}

export const headerActive=(value)=>{
    return{
        type:"ActiveStore",
        payload:value
    }
}

export const SwapSetting=(values)=>{
    return{
        type:"Setting",
        payload:values
    }
}
